import { useState } from "react";
import CompModal from "./components/CompModal";
import Compsum from "./components/Compsum";

function App() {

  const [cnt, setCnt] = useState()

  return (
    <>
    <h1>더하기문제</h1>
    <hr />
    <Compsum/>
    <Compsum/>

    <CompModal cnt={cnt}/>
    </>
  );
}

export default App;
